import React from "react";
import "./Checkout.scss";

const CheckoutPage = () => {
  return (
    <div className="CheckoutPage">
      <div className="checkout-headers">
        <h3>Product</h3>
        <h3>Description</h3>
        <h3>Quantity</h3>
        <h3>Price</h3>
        <h3>Remove</h3>
      </div>
      <div className="checkout-content">
        <img
          src="https://images.unsplash.com/photo-1592817707098-cfa915cd4d79?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=400&q=60"
          alt="pic"
        />
        <span>4</span>
        <h3>$25</h3>
        <span>X</span>
      </div>
    </div>
  );
};

export default CheckoutPage;
